B.asU=new A.h5("The following Terms and Conditions are to clear the dealing between us and clarify our duties towards each other during your usage of our services. Those Terms and Conditions are obligatory for the usage of our services, so by accepting them you are acknowledging that you will have not to do anything that violates any of the following points while using our services. Those Terms and Conditions are like a signed contract where if any of the 2 parties violate any of them, the Egyptian Courts according to the Egyptian Law will be the judge of any problem occurred during this violation.",null)
B.asV=new A.h5("The following Terms and Conditions are to clear the dealing between us and clarify our duties towards each other during your usage of our services.Those Terms and Conditions are obligatory for the usage of our services, so by accepting them you are acknowledge that you will have not to do anything that violates any of the following points while using our services.Those Terms and Conditions are like a signed contract where if any of the 2 parties violate any of them, the Egyptian Courts according to the Egyptian Law will be the judge of any problem occurred during this violation.",null)
B.N3=new A.h5("We process your data to insure that you get the best fit for you of our services and to always improve them.",null)
B.asW=new A.h5("Each party is obliged to keep strictly confidential of any company business secrets or technical information or any knowledge related to the other partyCamion is responsible for securing your all your data inside the system, including your business info, reports and \u2026.etc. You have to keep your password strict and not to give it to any other unauthorized person.You are responsible to keep all the info about Camion\u2019s process and system safe as well, including the reports, data analysis, prices and \u2026.etc.And hereby, Camion is authorized to record all thecalls between you and our Customer Service Team.Disclaimer: Camion disclaims all warranties of any kind.",null)
B.asX=new A.h5("Once you use our application or website we are authorized to access your device location in order to improve our booking system and to improve locating our trucks and mini-trucks. Overall, in order to improve our services to best fit you.",null)
B.asY=new A.h5("Camion is promising you a high quality service with a very organized and detailed-oriented system to cover all the transportation process.We provide the Shipper with the Insurance Service with very professional entities and with relatively low prices; the trip insurance will cover the compensation of damaged or lost items during the trip *check appendix 1 for more details of the insurance process*, however, it is an optional service that the Shipper might not choose, but, in case of not choosing it, s/he is totally responsible for the goods safety.",null)
B.asZ=new A.h5("We are always here to help you and serve you in the best way we can. For complaints, you can contact our Customer Service Team either by calling us on, sending an email to info@camion.com, sending a message through our Contact Us tab or by having a chat with us.",null)
B.at_=new A.h5("Any Data that identifies a natural person directly or indirectly such as (Name, Identification Number, Email, Password to Protect Your Account).",null)
B.at0=new A.h5("Camion is promising you a high quality service with a very organized and detailed-oriented system to cover all the transportation process.We provide you with the Insurance Service with very professional entities and with relatively low prices; the trip insurance will cover the compensation of damaged or lost items during the trip *check appendix 1 for more details of the insurance process*, however, it is an optional service that you might not choose, but, in case of not choosing it, you are totally responsible for the goods safety.",null)
B.at1=new A.h5("Shipper shall pay the fees (as agreed), also parking charges (if there is any), tolls and weights (if there is any) and any extra fees occur during the trip. Invoices will be introduced to the Shipper at delivery and s/he will have to pay it before the discharge of the goods at the end point, or as the agreed on process if s/he is having a special contract with us. In case the Shipper has a representative from his/her side with our driver, the driver is the only one who is allowed to deal with the tolls and weights all the time.",null)
B.at2=new A.h5("Camion is giving the Fleet Owners only 1 hour to place a bid on a request; there will be a timer showing you how much time is remaining for bidding on a certain request.",null)
B.at3=new A.h5("Once you use our application or website we are authorized to access your device location in order to improve our booking system and to improve locating our trucks and mini-trucks.Overall, in order to improve our services to best fit you.",null)
B.at4=new A.h5("We collect data such as: Real Name, Email Address, Password, Location Information, Device Information, Address and Credit Card Information.",null)
B.at5=new A.h5("Each party is obliged to keep strictly confidential of any company business secrets or technical information or any knowledge related to the other partyCamion is responsible for securing your all your data inside the system, including your business info, reports and \u2026.etc. You have to keep your password strict and not to give it to any other unauthorized person.You are responsible to keep all the info about Camion\u2019s process and system safe as well, including the reports, data analysis, prices and \u2026.etc.And hereby, Camion is authorized to record all the calls between you and our Customer Service Team.",null)
B.at6=new A.h5("Camion is promising you to have a minimum of 3 bids within 2 hours after placing a request as a max.However, you will receive a pop-up message every time you request a trip that shows you a reversed timer where you have to accept or reject the offers made to you before it went out.The time for request confirmation after getting the bids is up to 5 hours, ignoring the offers by either not accepting or rejecting them till the time is up for 3 times you will have your account blocked for a week, if you repeat it for extra 2 times you will have your account suspended for a month, and then those procedures will be repeated..",null)
B.at7=new A.h5("In case of Cash Payment: Payment will be upon delivery and before discharge of goods.\nIn case of Online Payment: 20% of the trip\u2019s cost will be put on hold on your card and the remaining 80% will be transferred from your card upon delivery and before discharge of goods.",null)
B.at8=new A.h5("We are always here to help you and serve you in the best way we can.For complaints, you can contact our Customer Service Team either by calling us on ***********, sending an email to info@camion.com, sending a message through our Contact Us tab or by having a chat with us",null)
B.at9=new A.h5("In case of Cash Payment: Payment will be upon delivery and before discharge of goods.\nIn case of Online Payment: 20% of the trip\u2019s cost will be put on hold on the Shipper\u2019s card and the remaining 80% will be transferred from the card upon delivery and before discharge of goods.The Fleet Owner will collect his money as agreed in his own offline contract with us.",null)
